import { styled } from "styled-components";
import userNull  from "/Users/han/Projects/seb44_pre_006/client/src/asset/User_null.png"
import { useSelector } from "react-redux";

const ProfileContainer = styled.section`
    display: flex;
    height: 12vh;
    width: 100%;
    border: 1px solid;
    align-items: center;
    justify-content: space-between;

    > .leftDiv {
        display: flex;
        height: 100%;
        align-items: center;
        >img{
        height: 100%;
        }
        > p {
        margin-left: 20px;
        font-size: 200%;
         }
    }

    > .rightDiv {
        display: flex;
        align-items: center;
        height: 100%;

        >bottom{

        }
    }




`

export default function ProfileHeader(){

    const user = useSelector(state => state.user)


    return(
        <>
        <ProfileContainer>
            <div className="leftDiv">
                <img src={userNull} alt="userNull"/>
                <p>{user.data.name}</p>
            </div>
            <div className="rightDiv">
                <button>Edit Profile</button>
                <button>Delete Profile</button>
            </div>
        </ProfileContainer>
        </>
    )
}
